(1, 1, '1001', '1001', 'Okonomiyaki', 'Japanese savoury pancake made of a special batter recipe, vegetables, squid, topped with bonito flakes.', 1, 0, 88, '2015-02-18 09:06:50', NULL, 0, NULL, 0),
(2, 1, '1002', '1002', 'Agedashi Tofu', 'Deep fried tofu in a light soy broth.', 1, 0, 101, '2015-02-18 09:08:51', NULL, 0, NULL, 0),
(3, 1, '1003', '1003', 'Yasai Itame', 'Classic Chinese vegetable dish of beansprouts, cabbage, carrots, bell peppers, onions and itame sauce.', 1, 0, 112, '2015-02-18 09:09:18', NULL, 0, NULL, 0),
(4, 1, '1004', '1004', 'Gyoza', 'Also known as potstickers, Japanese pork dumplings, steamed and seared until crisp, served with a tangy soy- based dipping sauce.', 1, 0, 122, '2015-02-18 09:09:49', NULL, 0, NULL, 0),
(5, 1, '1005', '1005', 'Tofu Steak', 'Breaded tofu topped with a sweet and savory sauce, finished with stir-fried pork, onions, chives, and shiitake steak sauce.', 1, 0, 170, '2015-02-18 09:13:30', NULL, 0, NULL, 0),
(6, 1, '1006', '1006', 'Tuna Croquette', 'Deep fried and crunchy tuna balls with green salad on the side.', 1, 0, 188, '2015-02-18 09:14:22', NULL, 0, NULL, 0),
(7, 1, '1007', '1007', 'Mentai Potato', 'Boiled potatoes and fish roe providing a different twist to a starter dish.', 1, 0, 268, '2015-02-18 09:14:53', NULL, 0, NULL, 0),
(8, 1, '2001', '2001', 'Crunchy Kani Maki', 'An American classic with a Japanese twist, Teppanyaki beef with deep-fried sweet onions topped with flame-torched cheese served with our own rolls dip.', 2, 0, 191, '2015-02-18 09:15:29', NULL, 0, NULL, 0),
(9, 1, '2002', '2002', 'California Roll', 'Crabstick salad with fresh mango coated with fresh shrimp roe.', 2, 0, 139, '2015-02-18 09:16:32', NULL, 0, NULL, 0),
(10, 1, '2003', '2003', 'Philly Cheese Steak Roll', 'An American classic with a Japanese twist, Teppanyaki beef with deep-fried sweet onions topped with flame-torched cheese served with our own rolls dip.', 2, 0, 191, '2015-02-18 09:17:15', NULL, 0, NULL, 0),
(11, 1, '2004', '2004', 'Crispy Spicy Shake Maki', 'A special blend of spicy salmon sashimi, onion leeks, tempura flakes.', 2, 0, 249, '2015-02-18 10:16:24', NULL, 0, NULL, 0),
(12, 1, '2005', '2005', 'Teriyaki Boy Chicken Maki', 'Teriyaki Boy Chicken in a roll  wrapped in nori, topped with a combo of chicken skin, grilled chicken and Japanese mayonnaise.', 2, 0, 289, '2015-02-18 10:17:07', NULL, 0, NULL, 0),
(13, 1, '2006', '2006', 'Dragon Maki', 'Named because of its shape, Dragon Maki is a savoury roll of breaded shrimp covered with sushi rice, topped with grilled eel and sprinkled with sesame seeds.', 2, 0, 399, '2015-02-18 10:17:41', NULL, 0, NULL, 0),
(14, 1, '2007', '2007', 'Tamago Sashimi', 'Japanese sweet omelette, served with fresh daikon and wasabi.', 2, 0, 96, '2015-02-18 10:18:08', NULL, 0, NULL, 0),
(15, 1, '2008', '2008', 'Tempura Tuna Tartare', 'A spicy mix of tuna sashimi, Japanese mayo, and tempura flakes. A bestseller in its own right.', 2, 0, 155, '2015-02-18 10:18:35', NULL, 0, NULL, 0),
(16, 1, '2009', '2009', 'Maguro Sashimi', 'Fresh yellowfin tuna, served with fresh daikon, pickled ginger and wasabi.', 2, 0, 160, '2015-02-18 10:19:01', NULL, 0, NULL, 0),
(17, 1, '2010', '2010', 'Shake Sashimi', 'Fresh Norwegian salmon, served with fresh daikon, pickled ginger and wasabi.', 2, 0, 211, '2015-02-18 10:19:39', NULL, 0, NULL, 0),
(18, 1, '3001', '3001', 'Tamago Sushi', 'Japanese sweet omelette on top of vinegared rice, served with wasabi.', 3, 0, 59, '2015-02-18 10:35:06', NULL, 0, NULL, 0),
(19, 1, '3002', '3002', 'Maguro Sushi', 'Fresh yellowfin tuna on top of vinegared rice, served with wasabi.', 3, 0, 91, '2015-02-18 10:35:38', NULL, 0, NULL, 0),
(20, 1, '3003', '3003', 'Shake Sushi', 'Fresh Norwegian salmon on top of vinegared rice, served with wasabi.', 3, 0, 105, '2015-02-18 10:36:03', NULL, 0, NULL, 0),
(21, 1, '4001', '4001', 'Miso Soup', 'A classic Japanese soup of fermented soy beans, served with wakame seaweed and diced silken tofu.', 4, 0, 54, '2015-02-18 10:49:43', NULL, 0, NULL, 0),
(22, 1, '4002', '4002', 'Tonjiru', 'Select vegetables cubed, pork strips, shiitake mushroom and tofu boiled using Miso as soup base. A perfect alternative to those who want a different kind of Miso soup.', 4, 0, 79, '2015-02-18 10:50:11', NULL, 0, NULL, 0),
(23, 1, '4003', '4003', 'Sukiyaki', 'Traditional Japanese stew of sliced beef, silken tofu, shiitake mushrooms, vegetables, glass noodles and raw egg.', 4, 0, 304, '2015-02-18 10:51:00', NULL, 0, NULL, 0),
(24, 1, '5001', '5001', 'Kani Salad', 'Japanese crabstick with mayo resting on top of a cucumber slaw, topped with fresh shrimp roe/Japanese caviar.', 5, 0, 139, '2015-02-18 10:51:48', NULL, 0, NULL, 0),
(25, 1, '5002', '5002', 'Lechon Kawali Salad', 'A Filipino-inspired dish made into a Japanese savoury salad. Crunchy lechon kawali on a bed of fresh greens drizzled with wasabi dressing.', 5, 0, 219, '2015-02-18 10:52:32', NULL, 0, NULL, 0),
(26, 1, '5003', '5003', 'Chashu Salad', 'Chashu slices and leafy greens with sesame dressing and sprinkled with sesame seeds.', 5, 0, 242, '2015-02-18 10:53:11', NULL, 0, NULL, 0),
(27, 1, '5004', '5004', 'Sashimi Salad', 'Cubes of fresh Norwegian salmon and yellowfin tuna in between of a bed of greens, crunchy kani strips and fresh shrimp roe served with our very own concoction of sashimi dressing.', 5, 0, 299, '2015-02-18 10:54:26', NULL, 0, NULL, 0),
(28, 1, '5005', '5005', 'Tori Karaage', 'Japanese style boneless chicken, deep-fried to perfection. Want it hot? Ask us to serve you the spicy kind.', 5, 0, 181, '2015-02-18 10:55:01', NULL, 0, NULL, 0),
(29, 1, '5006', '5006', 'Ebi Tempura', 'Fresh tiger prawns, battered and deep-fried until crispy. Served with special tempura sauce.', 5, 0, 191, '2015-02-18 10:55:41', NULL, 0, NULL, 0),
(30, 1, '5007', '5007', 'Mixed Seafood Kakiage Tempura', 'Julienne of mixed vegetables with shrimps, crabsticks, clam battered and deep-fried until golden brown. ', 5, 0, 199, '2015-02-18 10:56:24', NULL, 0, NULL, 0),
(31, 1, '5008', '5008', 'Chikuwa Fish Tempura', 'Battered and deep-fried, this fish cake dish is wrapped with nori and injected with cream cheese at the center. ', 5, 0, 219, '2015-02-18 10:57:40', NULL, 0, NULL, 0),
(32, 1, '5009', '5009', 'Tonkatsu', 'Fillet of high quality US pork, breaded and deep-fried until golden brown. Served with cabbage salad and a drizzle of sesame dressing.', 5, 0, 222, '2015-02-18 10:58:19', NULL, 0, NULL, 0),
(33, 1, '5010', '5010', 'Chicken Asparagus', 'Asparagus and chicken fillet-rolled and drizzled with wasabi cheese mayo.', 5, 0, 229, '2015-02-18 10:59:04', NULL, 0, NULL, 0),
(34, 1, '5011', '5011', 'Mixed Tempura', 'A medley of tiger prawns, asohos, shimeji mushrooms, eggplant, camote, carrots and beans battered and deep fried until crispy.', 5, 0, 229, '2015-02-18 10:59:36', NULL, 0, NULL, 0),
(35, 1, '5012', '5012', 'Chasyu Salad', 'Chasyu sliced and leafy greens with sesame dressing and sprinkled with sesame seeds. (MunchPunch)', 5, 0, 242, '2015-02-18 11:00:35', NULL, 0, NULL, 0),
(36, 1, '6001', '6001', 'Teriyaki Boy Chicken', 'Succulent boneless chicken, marinated and cooked with our very own Teriyaki Boy sauce.', 6, 0, 214, '2015-02-18 11:01:30', NULL, 0, NULL, 0),
(37, 1, '6002', '6002', 'Mixed Mushrooms', 'Four kinds of mushroom grilled in a mixture of butter, sake and Japanese soy sauce with a slice of lemon on the side.', 6, 0, 232, '2015-02-18 11:02:03', NULL, 0, NULL, 0),
(38, 1, '6003', '6003', 'Beef Tataki', 'Wafu steak, grilled and seared on top of a layer of buttered mixed mushrooms.', 6, 0, 499, '2015-02-18 11:02:52', NULL, 0, NULL, 0),
(39, 1, '7001', '7001', 'Sukiyaki Beef Teppanyaki', 'Beef bacon slices stir-fried with teppanyaki sauce and onion slices.', 7, 0, 165, '2015-02-18 11:03:54', NULL, 0, NULL, 0),
(40, 1, '7002', '7002', 'Asupara Bacon Maki', 'A modern Japanese dish of fresh asparagus spears wrapped in honey-glazed bacon strips seared to perfection.', 7, 0, 207, '2015-02-18 11:04:23', NULL, 0, NULL, 0),
(41, 1, '7003', '7003', 'Gyuniku Teriyaki', 'Thinly sliced beef, stir-fried with our Teriyaki Boy sauce. Served with a siding of savoury sesame moyashi.', 7, 0, 271, '2015-02-18 11:08:35', NULL, 0, NULL, 0),
(42, 1, '7004', '7004', 'Seafood Teppanyaki', 'Fresh prawns, yellowfin tuna, creamy dory and squid, stir-fried with bell peppers, onions, shiitake and teppanyaki sauce.', 7, 0, 335, '2015-02-18 11:09:26', NULL, 0, NULL, 0),
(43, 1, '7005', '7005', 'Wafu Steak', 'Premium diced-cut beef, perfectly seared and stir-fried with garlic and teppanyaki sauce, served with a siding of savoury sesame moyashi.', 7, 0, 366, '2015-02-18 11:10:41', NULL, 0, NULL, 0),
(44, 1, '8001', '8001', 'Yakisoba', 'Stir-fried thin Japanese noodles mixed with pork strips, fish cake, shiitake mushrooms and mixed vegetables topped with crunchy tempura and nori flakes.', 8, 0, 199, '2015-02-18 11:11:29', NULL, 0, NULL, 0),
(45, 1, '8002', '8002', 'Yaki Udon', 'Stir-fried thick Japanese noodles mixed with chicken strips, fish cake and mixed vegetables topped with crunchy tempura and nori flakes.', 8, 0, 249, '2015-02-18 11:12:07', NULL, 0, NULL, 0),
(46, 1, '8003', '8003', 'Gyuniku Ramen', 'Stir-fried beef slices topped with egg yolk, spring onions, black and white sesame seeds on sesame oil-drizzled ramen noodles in shoyu soup base.', 8, 0, 155, '2015-02-18 11:12:56', NULL, 0, NULL, 0),
(47, 1, '8004', '8004', '4.	Tanmen Ramen', 'Seafoods galore! Tiger prawn, creamy dory, and kamaboko, sided with sesame pechay, carrot slice, sesame moyashi and boiled egg. Garnished with curly leeks and cooked in Dobin.', 8, 0, 180, '2015-02-18 11:13:42', NULL, 0, NULL, 0),
(48, 1, '8005', '8005', 'Miso Ramen', 'A combination of ground pork, shiitake mushrooms, carrots, onion leeks and ramen noodles simmered in a miso soup base. ', 8, 0, 199, '2015-02-18 11:14:48', NULL, 0, NULL, 0),
